	//run print out function to print chunks onto the display
	public void printMap(Player user, String area) {
	
			chunk playerChunk = new chunk();
			chunk playerChunk2 = new chunk();
			if(area.equals("World1")) {
				playerChunk = modifyChunk(chunks.get(userrow).get(usercol), user, area, 1);
			}
			if(area.equals("Gym1") || area.equals("PokeStop1") || area.equals("House") || area.equals("PokeLab1")) {
				playerChunk = modifyChunk(chunks.get(userrow).get(usercol), user, area, 1);
				playerChunk2 = modifyChunk(chunks.get(userrow).get(usercol), user, area, 2);
			}
			if(size.equals("small")) {
			System.out.println("Area: " + area + " " + chunks.get(userrow).get(usercol).enterable);
			System.out.println("_".repeat(200));
			for(int j = 0; j < 8; j++) {
				for(int i = 0; i < 5; i++) {
					System.out.print("|");
					
					for(int col = 0; col < 11; col++) {
						if(area.equals("World1")) {
							if(userrow == j && usercol == col) {
								System.out.print(playerChunk.grid[i]);
							} else {
								System.out.print(chunks.get(j).get(col).grid[i]);
							}
						} else if (area.equals("PokeStop1") || area.equals("House")) {
							if(userrow == j && usercol == col) {
								System.out.print(playerChunk2.grid[i]);
							} else if(userrow == j+1 && usercol == col) {
								System.out.print(playerChunk.grid[i]);
							} else {
								System.out.print(chunks.get(j).get(col).grid[i]);
							}
						}
					}
				if(i != 7) {
					System.out.println("|");
				}
			}
		}
	} else if(size.equals("big")){
		System.out.println("_".repeat(200));
		for(int i = userrow-4; i < userrow+5; i++) {
			for(int gridIndex = 0; gridIndex < 5; gridIndex++) {
				if(i >= 0 && i < 24) {
				System.out.print("|");
				for(int j = usercol-5; j < usercol+6; j++) {
					if(userrow == i && usercol == j) {
						System.out.print(playerChunk2.grid[gridIndex]);
					} else if(userrow == i+1 && usercol ==j) {
						System.out.print(playerChunk.grid[gridIndex]);
					} else {
						System.out.print(chunks.get(i).get(j).grid[gridIndex]);
					}
				}
				System.out.println("|");
				
				}
			}
		}
	}
}		
	public void printSimpleMap() {
		game.spaces();
		System.out.println("_".repeat(200));
		for(int i = 0; i < 8; i++) {
			for(int index = 0; index < 5; index++) {
				System.out.print("|");
				for(int j = 0; j < 11; j++) {
					System.out.print(chunks.get(i).get(j).grid[index]);
				}
				System.out.println("|");
			}
		}
	}
	
	//process the user's input to move the character or do actions
	public void takeInput(String input, Player user, String area, ItemShopDatabase items, Map map, GrassPuzzle grasspuzzle) {
		prevrow = userrow;
		prevcol = usercol;
		if(input.equals("a")) {
			user.symbols[1][1] = user.symbols2[1][1];
			user.symbols[1][2] =  " ";
			if(size.equals("small")) {
				if(usercol != 0 && chunks.get(userrow).get(usercol-1).right == 1) {
					usercol -= 1;
				}
			} else if(size.equals("big")) {
				if(usercol-5 <= 0 || chunks.get(userrow).get(usercol-1).right == 0) return;
				usercol -=1;
			}
		} else if (input.equals("d")) {
			user.symbols[1][2] = user.symbols2[1][2];
			user.symbols[1][1] =  " ";
			if(size.equals("small")) {
				if(usercol != 10 && chunks.get(userrow).get(usercol+1).left == 1) {
					usercol += 1;
				}
			} else if(size.equals("big")) {
				if(usercol+5 >= 32 || chunks.get(userrow).get(usercol+1).left == 0) return;
				usercol += 1;
			}
		} else if(input.equals("w")) {
			user.symbols[1][1] = " ";
			user.symbols[1][2] = " ";
			if(size.equals("small")) {
				if(userrow != 0 && chunks.get(userrow-1).get(usercol).down == 1) {
					userrow -= 1;
				}
			} else if(size.equals("big")) {
				if(userrow-3 <= 0 || chunks.get(userrow-1).get(usercol).down == 0) return;
				userrow -= 1;
			}
		} else if(input.equals("s")) {
			user.symbols[1][1] = user.symbols2[1][1];
			user.symbols[1][2] = user.symbols2[1][2];
			if(size.equals("small")) {
				if(userrow != 7 && chunks.get(userrow+1).get(usercol).up == 1) {
					userrow += 1;
				}
			} else if(size.equals("big")) {
				if(userrow+3 >= 23 || chunks.get(userrow+1).get(usercol).up == 0) return;
				userrow += 1;
			}
		} else if(input.equals("t")) {
			user.openMenu(user, area, size, chunks);
		} else if(input.equals("c")) {
			if(chunks.get(userrow).get(usercol).enterable == 1){
				if(enterableChunks.get(mapGen+""+userrow+""+usercol) == null) return;
				String combinedRowCol = enterableChunks.get(mapGen+""+userrow+""+usercol);
				System.out.println(combinedRowCol);
				char[] pos = combinedRowCol.toCharArray();
				int parsedRow = 0; int parsedCol = 0;
//				int parsedRow = Integer.parseInt(String.valueOf(pos[0])); int parsedCol = Integer.parseInt(String.valueOf(pos[1]));
				
				if(pos[1] == '.') {
					parsedRow = Integer.parseInt(String.valueOf(pos[0])); parsedCol = Integer.parseInt(String.valueOf(pos[2]));
					System.out.println("double check 1.1");
				} else if(pos[2] == '.') {
					
					parsedRow = Integer.parseInt("" + String.valueOf(pos[0]) + String.valueOf(pos[1]));
					if(pos.length == 5) {
						parsedCol = Integer.parseInt("" + String.valueOf(pos[3]) + String.valueOf(pos[4]));
					} else {
						parsedCol = Integer.parseInt("" + String.valueOf(pos[3]));
					}
				}
				
				mapGen = chunks.get(userrow).get(usercol).enterArea;
				size = mapType.get(mapGen);
				for(int i = 0; i < 8; i++) {
					for(int j = 0; j < 11; j++) {
						chunks.get(i).get(j).enterable = 0;
						chunks.get(i).get(j).down = 1;chunks.get(i).get(j).up = 1;chunks.get(i).get(j).left = 1;chunks.get(i).get(j).right = 1;
					}
				}
				if(mapGen == "World1") {
					allChunksNonEnterableResetCollision();
				}
				if(mapGen == "Gym1") {
					grasspuzzle.updateVines();
				}
				userrow = parsedRow;usercol = parsedCol;
				setChunkValues(mapGen);
				return;
			}
			if(chunks.get(userrow).get(usercol).interactable == 1) {
				if((mapGen.equals("PokeStop1") || mapGen.equals("PokeStop2") || mapGen.equals("PokeStop3") )&& userrow == 3 && usercol == 5)  {
					items.pokeStopMenu(user, area, items, chunks, map);
				}
				if(mapGen.equals("House") && ((userrow == 2 && usercol == 1) || (userrow == 2 && usercol == 2))){
					user.customize();
				}
				if(mapGen.equals("Gym1")) {
					if((userrow == 8) && (usercol == 21 || usercol == 23) || (userrow == 9 && usercol == 22)) {
						if(grasspuzzle.one.position != 0 && grasspuzzle.one.next.position != 4) {
							grasspuzzle.one.position--;
							grasspuzzle.one.next.position++;
						}
						System.out.println("One changes" + grasspuzzle.one.next);
					}
					if((userrow == 9) && (usercol == 13 || usercol == 15) || (userrow == 10 && usercol == 14)) {
						if(grasspuzzle.two.position != 0 && grasspuzzle.two.next.position != 4) {
							grasspuzzle.two.position--;
							grasspuzzle.two.next.position++;
						}
					}
					if((userrow == 9) && (usercol == 23 || usercol == 25) || (userrow == 10 && usercol == 24)) {
						if(grasspuzzle.three.position != 0 && grasspuzzle.three.next.position != 4) {
							grasspuzzle.three.position--;
							grasspuzzle.three.next.position++;
						}
					}
					if((userrow == 8) && (usercol == 15 || usercol == 17) || (userrow == 9 && usercol == 16)) {
						if(grasspuzzle.four.position != 0 && grasspuzzle.four.next.position != 4) {
							grasspuzzle.four.position--;
							grasspuzzle.four.next.position++;
						}
					}
				}

			}
		}
}
	


	
